import React from 'react';
import { motion } from 'framer-motion';

const Skills = () => {
  const skills = [
    { name: "Manual Testing", icon: "洫ｪ", level: 90, color: "from-green-400 to-blue-500" },
    { name: "Selenium", icon: "笞呻ｸ十

from-teal-400 to-green-500" }
  ];

  return (
    <section className="py-20 px-4 bg-gray-900">
      <div className="max-w-6xl mx-auto">
        <motion.h2 
          className="text-6xl md:text-8xl font-black text-center mb-20 ultra-sharp"
          initial={{ opacity: 0, y: 100, rotateX: -90 }}
          whileInView={{ opacity: 1, y: 0, rotateX: 0 }}
          transition={{ duration: 1.5, ease: "easeOut" }}
          viewport={{ once: true }}
        >
          <span className="holo-text neon-text float-3d animate-rainbow-glow">
            Skills & Expertise
          </span>
          {/* Enhanced glow layers */}
          <motion.div
            className="absolute inset-0 opacity-30 blur-lg"
            style={{
              background: 'linear-gradient(45deg, #ffd700, #ff1493, #00ffff, #39ff14)',
              backgroundClip: 'text',
              WebkitBackgroundClip: 'text',
              WebkitTextFillColor: 'transparent'
            }}
            animate={{ opacity: [0.2, 0.5, 0.2] }}
            transition={{ duration: 3, repeat: Infinity }}
          >
            Skills & Expertise
          </motion.div>
        </motion.h2>

        <div className="grid md:grid-cols-2 lg:grid-cols-4 gap-8">
          {skills.map((skill, index) => (
            <motion.div
              key={skill.name}
              className="group relative p-6 bg-gray-800/50 rounded-xl backdrop-blur-sm border border-gray-700 hover:border-blue-400/50 transition-all duration-300"
              initial={{ opacity: 0, y: 50 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ delay: index * 0.1, duration: 0.6 }}
              viewport={{ once: true }}
              whileHover={{ 
                scale: 1.05,
                rotateY: 5,
                boxShadow: "0 20px 40px rgba(0,0,0,0.3)"
              }}
            >
              {/* Skill Icon */}
              <motion.div
                className="text-4xl mb-4 text-center"
                whileHover={{ scale: 1.2, rotate: 10 }}
                transition={{ duration: 0.3 }}
              >
                {skill.icon}
              </motion.div>

              {/* Skill Name */}
              <h3 className="text-lg font-semibold text-center mb-4 text-white group-hover:text-blue-400 transition-colors">
                {skill.name}
              </h3>

              {/* Progress Bar */}
              <div className="relative">
                <div className="w-full bg-gray-700 rounded-full h-3 mb-2">
                  <motion.div
                    className={`h-3 rounded-full bg-gradient-to-r ${skill.color}`}
                    initial={{ width: 0 }}
                    whileInView={{ width: `${skill.level}%` }}
                    transition={{ delay: index * 0.1 + 0.5, duration: 1, ease: "easeOut" }}
                    viewport={{ once: true }}
                  />
                </div>

                {/* Percentage */}
                <motion.span
                  className="text-sm text-gray-400 font-medium"
                  initial={{ opacity: 0 }}
                  whileInView={{ opacity: 1 }}
                  transition={{ delay: index * 0.1 + 1, duration: 0.5 }}
                  viewport={{ once: true }}
                >
                  {skill.level}%
                </motion.span>
              </div>

              {/* Hover glow effect */}
              <motion.div
                className={`absolute inset-0 bg-gradient-to-r ${skill.color} rounded-xl opacity-0 group-hover:opacity-10 transition-opacity duration-300 -z-10`}
                whileHover={{ scale: 1.1 }}
              />
            </motion.div>
          ))}
        </div>

        {/* Additional Skills Categories */}
        <motion.div
          className="mt-16 grid md:grid-cols-3 gap-8"
          initial={{ opacity: 0, y: 50 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ delay: 0.5, duration: 0.8 }}
          viewport={{ once: true }}
        >
          {[
            {
              title: "Testing Tools",
              items: ["Postman", "JIRA", "TestRail", "Cypress"],
              color: "from-green-400 to-blue-500"
            },
            {
              title: "Development",
              items: ["React", "Node.js", "MongoDB", "Express"],
              color: "from-blue-400 to-purple-500"
            },
            {
              title: "Design & Others",
              items: ["Figma", "Git", "Agile", "Scrum"],
              color: "from-pink-400 to-red-500"
            }
          ].map((category, index) => (
            <motion.div
              key={category.title}
              className="p-6 bg-gray-800/30 rounded-xl border border-gray-700"
              whileHover={{ scale: 1.02 }}
              transition={{ duration: 0.3 }}
            >
              <h3 className={`text-xl font-semibold mb-4 bg-gradient-to-r ${category.color} bg-clip-text text-transparent`}>
                {category.title}
              </h3>
              <div className="flex flex-wrap gap-2">
                {category.items.map((item, itemIndex) => (
                  <motion.span
                    key={item}
                    className="px-3 py-1 bg-gray-700 text-gray-300 rounded-full text-sm hover:bg-blue-600 hover:text-white transition-colors cursor-default"
                    initial={{ opacity: 0, scale: 0.8 }}
                    whileInView={{ opacity: 1, scale: 1 }}
                    transition={{ delay: index * 0.1 + itemIndex * 0.05, duration: 0.3 }}
                    viewport={{ once: true }}
                    whileHover={{ scale: 1.1 }}
                  >
                    {item}
                  </motion.span>
                ))}
              </div>
            </motion.div>
          ))}
        </motion.div>
      </div>
    </section>
  );
};

export default Skills;
